import React from 'react';
import logo from './logo.svg';

const Header = () => {
  return (
  <>
   <div className='header'> 
   <h1> Thakur Keep </h1>
   <img src={logo} width='500' alt='logo' />
   </div>

  </>
  );
};

export default Header;
